import React from 'react'
import {Text,View, StyleSheet,Image} from 'react-native'

export default function CardComponent() {
    return(
        /*Her har vi et et View med klasse navnet container*/
        <View style={styles.container}>
            <Text>JEG ER CardComponent</Text>
            <Image style={styles.img} source={require('../assets/img/elementor-logo.png')}/>
        </View>
    )
}

const styles = StyleSheet.create({
    container:{
        backgroundColor:'red',
        width: '10rem',
        justifyContent:'center',

    },
    img:{
        width:100,
        height:100
    }
})
